import React, { useState, useEffect } from 'react';
import axios from 'axios';

const StudentMarks = () => {
  const [marks, setMarks] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchMarks = async () => {
      try {
        setLoading(true);
        const response = await axios.get('http://localhost:5000/api/student/marksviewstudent', {
          withCredentials: true,
        });

        if (response.data.success) {
          setMarks(response.data.marks);
        } else {
          setError(response.data.message || 'Unknown error');
        }
      } catch (error) {
        setError('An error occurred while fetching marks.');
      } finally {
        setLoading(false);
      }
    };

    fetchMarks();
  }, []);

  const parseMarks = (marksString) => {
    try {
      return JSON.parse(marksString);
    } catch (error) {
      return {};
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>Student Marks</h2>

      {loading && <div style={styles.loadingSpinner}></div>}

      {error && <p style={styles.error}>{error}</p>}

      {!loading && !error && (
        <div>
          <h3 style={styles.subHeader}>Your Marks</h3>
          {marks && marks.length > 0 ? (
            marks.map((mark, index) => {
              const subjectMarks = parseMarks(mark.marks);
              return (
                <div key={index} style={styles.card}>
                  <h4 style={styles.cardHeader}>{mark.semester}</h4>
                  <table style={styles.table}>
                    <thead>
                      <tr style={styles.tableHeader}>
                        <th>Subject</th>
                        <th>Marks</th>
                      </tr>
                    </thead>
                    <tbody>
                      {Object.keys(subjectMarks).map((subject, idx) => (
                        <tr
                          key={idx}
                          style={styles.tableRow}
                          onMouseEnter={(e) => (e.currentTarget.style.backgroundColor = '#f4f8fb')}
                          onMouseLeave={(e) => (e.currentTarget.style.backgroundColor = '')}
                        >
                          <td style={styles.tableCell}>{subject}</td>
                          <td style={styles.tableCell}>{subjectMarks[subject]}</td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              );
            })
          ) : (
            <p style={styles.noMarks}>No marks found.</p>
          )}
        </div>
      )}
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    padding: '40px',
    backgroundColor: '#f0f8ff', // Soft blue background
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  header: {
    textAlign: 'center',
    color: '#1f4f91', // Darker blue for header
    fontSize: '36px',
    fontWeight: 'bold',
    marginBottom: '30px',
  },
  subHeader: {
    color: '#1565c0', // Lighter blue for subheader
    fontSize: '28px',
    marginBottom: '20px',
    textAlign: 'center',
  },
  loadingSpinner: {
    border: '4px solid #ddd',
    borderTop: '4px solid #1e88e5', // Blue spinner color
    borderRadius: '50%',
    width: '50px',
    height: '50px',
    animation: 'spin 1s linear infinite',
    marginTop: '20px',
  },
  error: {
    color: 'red',
    textAlign: 'center',
    marginTop: '20px',
    fontSize: '16px',
  },
  card: {
    marginBottom: '30px',
    padding: '20px',
    backgroundColor: '#fff',
    borderRadius: '10px',
    boxShadow: '0 6px 15px rgba(0, 0, 0, 0.1)',
    width: '80%',
    maxWidth: '900px',
    marginLeft: 'auto',
    marginRight: 'auto',
  },
  cardHeader: {
    color: '#0d47a1', // Blue header for each card
    fontSize: '24px',
    marginBottom: '15px',
    fontWeight: '600',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    marginTop: '20px',
    borderRadius: '8px',
    overflow: 'hidden',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', // Shadow for table
  },
  tableHeader: {
    backgroundColor: '#1565c0', // Blue header for table
    color: '#fff',
    textAlign: 'left',
    padding: '12px',
    fontSize: '16px',
    fontWeight: 'bold',
  },
  tableRow: {
    cursor: 'pointer',
    transition: 'background-color 0.3s ease',
  },
  tableCell: {
    padding: '12px 15px',
    borderBottom: '1px solid #ddd',
    textAlign: 'left',
    fontSize: '16px',
    color: '#424242', // Dark grey text for better readability
  },
  noMarks: {
    textAlign: 'center',
    fontSize: '18px',
    color: '#7f8c8d',
  },
};

export default StudentMarks;
